import Footers from "../components/Footers";
import Advertise from "../components/Advertise";
import Cards from "../components/Cards";

import Banners from "../components/Banners";

const tech = {"title":"title", "urlToImage":"https://staticg.sportskeeda.com/editor/2021/11/caca5-16370851386444-1920.jpg", "description":"description", "author":"author", "content":"content"}
const DetailTechList = () => {
  return (
    <div>
        <div className="detail">

        <Cards tech={tech}/>
        <Advertise tech={tech}/>
        <Advertise tech={tech}/>
        </div>

      <Footers />
    </div>
  );
};

export default DetailTechList;
